import React from 'react';
import ReactDOM from 'react-dom';
import './Booking.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image';
import pic1 from "./villa.png";
import pic2 from "./room.png";

function Booking() {
  return (
<div className="bookingContent">
<Container>
      <Row>
        <Col>
          <Image className="putToStart" src={pic2} alt="room" fluid />
        </Col>
        <Col>
          <h1>Book Now</h1>
          <p>
          Ut congue sem a risus lobortis, vel vulputate mauris dignissim. Curabitur suscipit urna ipsum, eu iaculis metus dictum id. Quisque vehicula mauris a auctor tincidunt. Aenean a urna vitae massa euismod maximus. Duis faucibus a ligula in mattis. Curabitur feugiat viverra varius. Morbi et malesuada arcu, in auctor sapien. In nec purus a massa facilisis semper maximus sit amet diam. Ut in dui quis nisl euismod pellentesque. Nulla mattis faucibus ipsum eget eleifend. Praesent varius dignissim tincidunt. Fusce convallis purus nisl, eu pretium velit ullamcorper a.
          </p>
        </Col>
        <Col>
          <Image className="putToEnd" src={pic1} alt="villa" fluid />
        </Col>
      </Row>
</Container>
</div>
)
}

export default Booking;
